import React, { useState, useEffect } from 'react';
import { fetchGPT3Insights } from './api'; // Ensure this path matches your project structure

function GPT3Insights({ dataIdentifier }) {
    const [insights, setInsights] = useState('');
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const getInsights = async () => {
            if (dataIdentifier) {
                try {
                    const response = await fetchGPT3Insights(dataIdentifier);
                    setInsights(response.insights);
                } catch (error) {
                    setInsights('Error fetching insights.');
                }
            }
            setLoading(false);
        };

        getInsights();
    }, [dataIdentifier]);

    return (
        <div className="GPT3Insights">
            <div className="section-title">GPT-3 Insights</div>
            {loading ? (
                <p>Loading insights...</p>
            ) : insights ? (
                <p>{insights}</p>
            ) : (
                <p>No insights available. Ensure data is uploaded and processed.</p>
            )}
        </div>
    );
}

export default GPT3Insights;
